import React from "react";
import { Box, Image, Text } from "@chakra-ui/react";
import { Keyboard, Pagination, Navigation } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

// carousel styles
import "swiper/css";

function Herocarousel() {
  return (
    <>
      <Swiper
        slidesPerView={1}
        spaceBetween={10}
        breakpoints={{
          300: {
              
          },

          640: {slidesPerView: 2,
            spaceBetween: 20,
            
          },
          768: {
            slidesPerView: 4,
            spaceBetween: 40,
          },
          1024: {
            slidesPerView: 5,
            spaceBetween: 50,
          },
        }}
        keyboard={{
          enabled: true,
        }}
        navigation={true}
        modules={[Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          {" "}
          <Box
            // border="1px solid"
            display="flex"
            justifyContent={["center", "center", "center", "center"]}
            padding="1rem"
          >
            <Image src="https://picsum.photos/200/300/?blur" boxSize="25%" />
            {/* <Image
              src="https://picsum.photos/200/300"
              boxSize="25%"
            /> */}
          </Box>
        </SwiperSlide>
        <SwiperSlide>
          <Box
            // border="1px solid"
            padding="1rem"
            display="flex"
            justifyContent={["center", "center", "center", "center"]}
          >
            <Image src="https://picsum.photos/200/300" boxSize="25%" />
          </Box>
        </SwiperSlide>
        <SwiperSlide>
          <Box
            // border="1px solid"
            padding="1rem"
            display="flex"
            justifyContent={["center", "center", "center", "center"]}
          >
            <Image
              src="https://picsum.photos/seed/picsum/200/300"
              boxSize="25%"
            />
          </Box>
        </SwiperSlide>
      </Swiper>
      {/* </Box> */}
    </>
  );
}

export default Herocarousel;
